import React from 'react'

function Search({ handleInput, search }) {
    return (
        <section className="searchbox-wra">
            <input
                type="text" placeholder="search for movies..." className='searchbox' onChange={handleInput}
                onKeyPress={search} />
        </section>
    )
}

export default Search
